import React from 'react';
//Styles
import './Team.css';
//Component
import Header from '../Header/Header';
//Data
import { STAFF } from '../../shared/staff';



const staffCard = ({element}) => (
    <div className="staff__card">
        <img>{element.image}</img>
        <h2>{element.title} Meet {element.name}</h2>
        <h4>{element.description}</h4>
    </div>
);

const renderStaffs = (staffs) => staffs.map(staff => staffCard(staff));

const Team = () => {
    const staffs = STAFF;

    return (
        <div>
            <Header color={'var(--DarkNavy)'} barColor={'var(--Blue)'} />
            <div className="staff_grid">
                {renderStaffs(staffs)} 
            </div>
        </div>
    );
}

export default Team;
